CREATE TABLE `tb_seckill_time`  (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '秒杀分类名字,双十一秒杀，每日时段秒杀等',
  `starttime` time(0) NOT NULL COMMENT '开始时间',
