-- ----------------------------
-- Table structure for tb_sku
-- ----------------------------
DROP TABLE IF EXISTS `tb_sku`;
CREATE TABLE `tb_sku`  (
  `id` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品id',
  `name` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'SKU名称',
  `price` int(20) NOT NULL DEFAULT 1 COMMENT '价格（分）',
  `seckill_price` int(20) NULL DEFAULT NULL COMMENT '单位，分',
  `num` int(10) NULL DEFAULT 100 COMMENT '库存数量',
  `alert_num` int(11) NULL DEFAULT NULL COMMENT '库存预警数量',
  `image` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品图片',
  `images` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品图片列表',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `spu_id` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'SPUID',
  `category1_id` int(10) NULL DEFAULT NULL COMMENT '类目ID',
  `category2_id` int(10) NULL DEFAULT NULL,
  `category3_id` int(10) NULL DEFAULT NULL,
  `category1_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `category2_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `category3_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '类目名称',
  `brand_id` int(11) NULL DEFAULT NULL,
  `brand_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '品牌名称',
  `spec` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '规格',
  `sale_num` int(11) NULL DEFAULT 0 COMMENT '销量',
  `comment_num` int(11) NULL DEFAULT 0 COMMENT '评论数',
  `seckill_end` datetime(0) NULL DEFAULT NULL COMMENT '秒杀结束时间',
  `seckill_begin` datetime(0) NULL DEFAULT NULL COMMENT '秒杀开始时间',
  `status` int(1) NULL DEFAULT 1 COMMENT '商品状态 1普通商品，2参与秒杀',
  `islock` int(1) NULL DEFAULT 1 COMMENT '是否锁定，1：未锁定，2：锁定',
  `seckill_num` int(11) NULL DEFAULT NULL COMMENT '秒杀数量',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `cid`(`category1_id`) USING BTREE,
  INDEX `status`(`status`) USING BTREE,
  INDEX `updated`(`update_time`) USING BTREE,
  INDEX `spu_id`(`spu_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品表' ROW_FORMAT = Dynamic;

